import { css } from '@emotion/react';
import { Input, Search } from 'antd';

const inputSearchStyle = css`
    margin-top:"20px";
    margin-left:"15%";
    width:"70%";
`;

const SearchForm = () => {
    return(
        <Input.Search css={inputSearchStyle}/>
    )
}

export default SearchForm;
